import React, { useState } from 'react';
import { Task } from '../models/Task';
import {
  List,
  ListItem,
  Checkbox,
  IconButton,
  ListItemText,
  Paper,
  Typography,
  Box,
  Divider,
  Tooltip,
  TextField,
} from '@mui/material';
import DeleteIcon from '@mui/icons-material/Delete';
import EditIcon from '@mui/icons-material/Edit';
import CheckIcon from '@mui/icons-material/Check';
import CloseIcon from '@mui/icons-material/Close';

interface TaskListProps {
  tasks: Task[];
  onToggle: (task: Task) => Promise<void>;
  onUpdate: (task: Task) => Promise<void>;
  onDelete: (id: number) => Promise<void>;
}

const TaskList = ({ tasks, onUpdate, onDelete }: TaskListProps) => {
  const [editingTask, setEditingTask] = useState<Task | null>(null);
  const [editedTitle, setEditedTitle] = useState('');
  const [isProcessing, setIsProcessing] = useState(false);

  const handleEditClick = (task: Task) => {
    setEditingTask(task);
    setEditedTitle(task.title);
  };

  const handleSaveEdit = async () => {
    if (editingTask) {
      setIsProcessing(true);
      try {
        await onUpdate({ ...editingTask, title: editedTitle });
        setEditingTask(null);
      } finally {
        setIsProcessing(false);
      }
    }
  };

  const handleCancelEdit = () => {
    setEditingTask(null);
  };

  const handleDeleteClick = (id: number) => {
    setEditingTask(null);
    setIsProcessing(true);
    onDelete(id).finally(() => setIsProcessing(false));
  };

  const handleToggleComplete = async (task: Task) => {
    setIsProcessing(true);
    try {
      await onUpdate({ ...task, completed: !task.completed });
    } finally {
      setIsProcessing(false);
    }
  };

  if (!tasks.length) {
    return (
      <Paper elevation={2} sx={{ p: 3, borderRadius: 2, mt: 2 }}>
        <Typography color="text.secondary" align="center">
          No tasks yet. Add your first task!
        </Typography>
      </Paper>
    );
  }

  return (
    <Paper elevation={2} sx={{ p: 0, borderRadius: 2, mt: 2 }}>
      <List>
        {tasks.map((task, idx) => (
          <React.Fragment key={task.id}>
            <ListItem
              sx={{
                bgcolor: task.completed ? '#f0f4ff' : '#fff',
                borderRadius: 2,
                mb: 1,
                boxShadow: 0,
                transition: 'background 0.2s',
              }}
              secondaryAction={
                editingTask?.id === task.id ? null : ( // Hide edit/delete when editing
                  <Box>
                    <Tooltip title="Edit">
                      <IconButton edge="end" color="primary" onClick={() => handleEditClick(task)}>
                        <EditIcon />
                      </IconButton>
                    </Tooltip>
                    <Tooltip title="Delete">
                      <IconButton edge="end" color="error" onClick={() => handleDeleteClick(task.id!)}>
                        <DeleteIcon />
                      </IconButton>
                    </Tooltip>
                  </Box>
                )
              }
            >
              <Checkbox
                edge="start"
                checked={task.completed}
                onChange={() => handleToggleComplete(task)}
                color="primary"
                disabled={isProcessing || editingTask?.id === task.id}
              />
              {editingTask?.id === task.id ? (
                <ListItemText
                  primary={
                    <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                      <TextField
                        variant="standard"
                        value={editedTitle}
                        onChange={(e) => setEditedTitle(e.target.value)}
                        disabled={isProcessing}
                        fullWidth
                      />
                      <IconButton
                        color="success"
                        onClick={handleSaveEdit}
                        disabled={isProcessing || !editedTitle.trim()}
                        sx={{ ml: 1 }}
                      >
                        <CheckIcon />
                      </IconButton>
                      <IconButton
                        color="error"
                        onClick={handleCancelEdit}
                        disabled={isProcessing}
                      >
                        <CloseIcon />
                      </IconButton>
                    </Box>
                  }
                />
              ) : (
                <ListItemText
                  primary={
                    <Typography
                      sx={{
                        textDecoration: task.completed ? 'line-through' : 'none',
                        color: task.completed ? 'text.secondary' : 'text.primary',
                        fontWeight: 'normal',
                      }}
                    >
                      {task.title}
                    </Typography>
                  }
                />
              )}
            </ListItem>
            {idx < tasks.length - 1 && <Divider />}
          </React.Fragment>
        ))}
      </List>
    </Paper>
  );
};

export default TaskList;
